import React, { useState, useEffect } from 'react';
import {
  Grid,
  Paper,
  Typography,
  Box,
  CircularProgress,
  Alert
} from '@mui/material';
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer
} from 'recharts';
import {
  BarChart,
  Bar,
} from 'recharts';

const Dashboard = () => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [metrics, setMetrics] = useState(null);
  const [riskTrends, setRiskTrends] = useState([]);
  const [userSegments, setUserSegments] = useState([]);

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      setLoading(true);
      setError(null);

      // Fetch metrics
      const metricsResponse = await fetch('/api/model/metrics');
      if (!metricsResponse.ok) {
        throw new Error('Failed to fetch metrics');
      }
      const metricsData = await metricsResponse.json();
      setMetrics(metricsData);

      // Fetch risk trends
      const trendsResponse = await fetch('/api/risk-analysis/trends');
      if (!trendsResponse.ok) {
        throw new Error('Failed to fetch risk trends');
      }
      const trendsData = await trendsResponse.json();
      setRiskTrends(trendsData);

      // Fetch user segments
      const segmentsResponse = await fetch('/api/risk-analysis/segments');
      if (!segmentsResponse.ok) {
        throw new Error('Failed to fetch user segments');
      }
      const segmentsData = await segmentsResponse.json();
      setUserSegments(segmentsData);

    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="400px">
        <CircularProgress />
      </Box>
    );
  }

  if (error) {
    return (
      <Alert severity="error" sx={{ mt: 2 }}>
        {error}
      </Alert>
    );
  }

  return (
    <Grid container spacing={3}>
      {/* Key Metrics */}
      <Grid item xs={12} md={4}>
        <Paper sx={{ p: 2, display: 'flex', flexDirection: 'column', height: 240 }}>
          <Typography component="h2" variant="h6" color="primary" gutterBottom>
            Model Performance
          </Typography>
          {metrics && (
            <Box>
              <Typography variant="h4" gutterBottom>
                {metrics.auc.toFixed(3)}
              </Typography>
              <Typography color="text.secondary">AUC Score</Typography>
              <Typography variant="h4" gutterBottom sx={{ mt: 2 }}>
                {metrics.approval_rate.toFixed(2)}%
              </Typography>
              <Typography color="text.secondary">Approval Rate</Typography>
            </Box>
          )}
        </Paper>
      </Grid>
      <Grid item xs={12} md={4}>
        <Paper sx={{ p: 2, display: 'flex', flexDirection: 'column', height: 240 }}>
          <Typography component="h2" variant="h6" color="primary" gutterBottom>
            Risk Distribution
          </Typography>
          {userSegments.length > 0 && (
            <ResponsiveContainer width="100%" height={180}>
              <BarChart data={userSegments}>
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="segment" />
                <YAxis />
                <Tooltip />
                <Bar dataKey="count" fill="#8884d8" />
              </BarChart>
            </ResponsiveContainer>
          )}
        </Paper>
      </Grid>
      <Grid item xs={12} md={4}>
        <Paper sx={{ p: 2, display: 'flex', flexDirection: 'column', height: 240 }}>
          <Typography component="h2" variant="h6" color="primary" gutterBottom>
            Recent Activity
          </Typography>
          {metrics && (
            <Box>
              <Typography variant="h4" gutterBottom>
                {metrics.recent_adjustments}
              </Typography>
              <Typography color="text.secondary">Model Adjustments</Typography>
              <Typography variant="h4" gutterBottom sx={{ mt: 2 }}>
                {metrics.new_features}
              </Typography>
              <Typography color="text.secondary">New Features</Typography>
            </Box>
          )}
        </Paper>
      </Grid>

      {/* Risk Trends Chart */}
      <Grid item xs={12}>
        <Paper sx={{ p: 2, display: 'flex', flexDirection: 'column', height: 400 }}>
          <Typography component="h2" variant="h6" color="primary" gutterBottom>
            Risk Score Trends
          </Typography>
          {riskTrends.length > 0 && (
            <ResponsiveContainer width="100%" height={300}>
              <LineChart data={riskTrends}>
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="date" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Line
                  type="monotone"
                  dataKey="average_risk_score"
                  stroke="#8884d8"
                  name="Average Risk Score"
                />
                <Line
                  type="monotone"
                  dataKey="default_rate"
                  stroke="#82ca9d"
                  name="Default Rate"
                />
              </LineChart>
            </ResponsiveContainer>
          )}
        </Paper>
      </Grid>

      {/* Feature Performance */}
      <Grid item xs={12}>
        <Paper sx={{ p: 2, display: 'flex', flexDirection: 'column', height: 400 }}>
          <Typography component="h2" variant="h6" color="primary" gutterBottom>
            Feature Importance
          </Typography>
          {metrics && metrics.feature_importance && (
            <ResponsiveContainer width="100%" height={300}>
              <BarChart
                data={metrics.feature_importance}
                layout="vertical"
              >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis type="number" />
                <YAxis type="category" dataKey="name" />
                <Tooltip />
                <Bar dataKey="importance" fill="#8884d8" />
              </BarChart>
            </ResponsiveContainer>
          )}
        </Paper>
      </Grid>
    </Grid>
  );
};

export default Dashboard;
